import React from "react";
import "../styles/SeedForm.css";
import backIcon from "../images/back.png";

import searchIcon from "../images/buscar.png";
import filterIcon from "../images/filtrar.png";
import addIcon from "../images/agregar.png";

import seedIconMain from "../images/semilla.png";
import seedIconAlt from "../images/semilla2.png";

import editIcon from "../images/editar.png";
import deleteIcon from "../images/eliminar.png";
import detailsIcon from "../images/detalles.png";
export default function RegisterSeed({ onBack }) {
  return (
    <div className="seed-form-container">
      <div className="seed-form-header">
        <button className="back-btn" onClick={onBack}>
          <img src={backIcon} alt="" />
        </button>
        <h2>Registrar semilla</h2>
      </div>

      <div className="seed-form-box">
        <label>FECHA COMPRA:</label>
        <input type="date" />

        <label>CANTIDAD:</label>
        <input type="number" placeholder="Ingrese cantidad" />

        <label>NOMBRE PLANTA:</label>
        <input type="text" placeholder="Nombre de la planta" />

        <label>PROVEEDOR:</label>
        <input type="text" placeholder="Proveedor" />

        <label>VARIEDAD:</label>
        <input type="text" placeholder="Variedad" />

        <label>OBSERVACIONES:</label>
        <textarea placeholder="Notas adicionales"></textarea>

        <button className="btn-submit">Registrar</button>
      </div>
    </div>
  );
}
